function App() {
  // const dispatch = useDispatch();
  const access = localStorage.getItem('access_token');

  // useEffect(()=> {
  //   dispatch(checkAuth());
  // }, [dispatch]);

  return (
    <Router>
      <ToastContainer/>
      <Routes>
          <Route exact path="/" element={< Generator/>} />
          <Route path="/login" element={< Login/>} />
          <Route path="/sign-up" element={< Register/>} />
      </Routes>
    </Router>

  )
}

export default App;
